import React, {useState, useEffect} from 'react';

function Produto() {
const [product, setProduct] = useState([]);
function handleTopo() {
  if(window.scrollY > 200) {
    console.log('open');
  } else {
    console.log('close');
  }
}


  return (
    <>
        <h1>Produto</h1>
    </>
);
}


export default Produto;
